/*
*/
void read_refsymbolfile(std::string filename, std::vector<std::complex<double> >& refSymbols){

    std::ifstream refsymfile(filename.c_str());

    std::string real_line;
    std::string imag_line;

    if(refsymfile.is_open()){
            getline(refsymfile,real_line);
            getline(refsymfile,imag_line);
    }
    else{
        std::cout<<"Failed to open "<<filename<<std::endl;
        exit(0);
    }

    while(1){

        size_t real_loc = real_line.find(", ");
        size_t imag_loc = imag_line.find(", ");

        if (real_loc == std::string::npos){
            break;
        }

        std::string realref_str = real_line.substr(0,real_loc);
        std::string imagref_str = imag_line.substr(0,imag_loc);
        double real_value = std::atof(realref_str.c_str());
        double imag_value = std::atof(imagref_str.c_str());
        refSymbols.push_back(std::complex<double>(real_value,imag_value) );

        real_line = real_line.substr(real_loc+1,real_line.length());
        imag_line = imag_line.substr(imag_loc+1,imag_line.length());
    }
}

